func TestBlockFromRaw_ErigonMerge(t *testing.T) {
	raw := ``

	// This bad block was found ropsten:
	// ########## BAD BLOCK #########
	// Chain config: {ChainID: 3 Homestead: 0 DAO: <nil> DAOSupport: true EIP150: 0 EIP155: 10 ...
	// Number: 12637606
	// Hash: 0x71b9dbd908ecb52ae0cb183e5a7a238b08fbcfe79ca38befcd222b2ac41fd6e9
	// Error: could not apply tx 19 [0x5d7c132dbcab7511b78de0fad3d4a37988b438bd50db5f77e63213b691dd1c1f]: invalid chain id for signer
	// ##############################

	block := eth.Block{}
	err := block.FromRaw(raw)
	require.NoError(t, err)

	require.Equal(t, "0x71b9dbd908ecb52ae0cb183e5a7a238b08fbcfe79ca38befcd222b2ac41fd6e9", block.Hash.String())
	require.Equal(t, int64(12637606), block.Number.Int64())
	require.Len(t, block.Transactions, 27)

	// The tx at index 19 is flawed and should have a chain id of 3 since this block is from ropsten
	// but actually has a chain id of 2 (morden!).
	tx := block.Transactions[19]
	require.NoError(t, err)
	require.Equal(t, int64(2), tx.ChainId.Int64())
	require.Equal(t, "0x5d7c132dbcab7511b78de0fad3d4a37988b438bd50db5f77e63213b691dd1c1f", tx.Hash.String())
}

func TestBlock_FromRaw_ZhejiangBlock(t *testing.T) {
	// the rawRLP of block 0xa80f (43023) on Zhejiang obtained via:
	// curl https://rpc.zhejiang.ethpandaops.io/ -H 'Content-Type: application/json' -d '{"method":"debug_getRawBlock","params":["0xa80f"],"id":1,"jsonrpc":"2.0"}'
	rawRLP := ``

	// let's ensure we get the same eth.Block from both JSON and RLP
	// the rawJSON below is obtained from:
	//   curl https://rpc.zhejiang.ethpandaops.io/ -H 'Content-Type: application/json' -d '{"method":"eth_getBlockByNumber","params":["0xa80f",false],"id":1,"jsonrpc":"2.0"}'
	rawJSON := `{"baseFeePerGas":"0x7","difficulty":"0x0","extraData":"0x","gasLimit":"0x1c9c380","gasUsed":"0x0","hash":"0x5affb899fa8ffaa05c5eb0b6a575c188e07b6e5a9e2bfacc68fef07c6e03e16d","logsBloom":"","miner":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","mixHash":"0x29826a39a321555d4c49136f75940cbf2905aa6d83eeabe4caf78459034c4c1c","nonce":"0x0000000000000000","number":"0xa80f","parentHash":"0xdee92882dee56c645f143c789ea73ce49fd4fcf0f32f33e761c27c992ea6fc7d","receiptsRoot":"0x56e81f171bcc55a6ff8345e692c0f86e5b48e01b996cadc001622fb5e363b421","sha3Uncles":"0x1dcc4de8dec75d7aab85b567b6ccd41ad312451b948a7413f0a142fd40d49347","size":"0x424","stateRoot":"0x2a746996126dee2bdfad85143f6faa8577e7277ebfdbc8047e8f21e212cf624e","timestamp":"0x63e28a08","totalDifficulty":"0x1","transactions":[],"transactionsRoot":"0x56e81f171bcc55a6ff8345e692c0f86e5b48e01b996cadc001622fb5e363b421","uncles":[],"withdrawals":[{"index":"0x2005","validatorIndex":"0xbd00","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2006","validatorIndex":"0xbd01","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2007","validatorIndex":"0xbd02","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2008","validatorIndex":"0xbd03","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2009","validatorIndex":"0xbd04","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200a","validatorIndex":"0xbd05","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200b","validatorIndex":"0xbd06","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200c","validatorIndex":"0xbd07","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200d","validatorIndex":"0xbd08","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200e","validatorIndex":"0xbd09","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x200f","validatorIndex":"0xbd0a","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2010","validatorIndex":"0xbd0b","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2011","validatorIndex":"0xbd0c","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2012","validatorIndex":"0xbd0d","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2013","validatorIndex":"0xbd0e","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"},{"index":"0x2014","validatorIndex":"0xbd0f","address":"0xf97e180c050e5ab072211ad2c213eb5aee4df134","amount":"0x2546b"}],"withdrawalsRoot":"0xc209d0a9f422316d602b55ff3aa0b45d09883d1e835c3aea080754c5a12478c4"}`

	blockFromJSON := eth.Block{}
	err := json.Unmarshal([]byte(rawJSON), &blockFromJSON)
	require.NoError(t, err)

	blockFromRLP := eth.Block{}
	err = blockFromRLP.FromRaw(rawRLP)
	require.NoError(t, err)

	t.Run("compare JSON and RLP", func(t *testing.T) {
		require.Equal(t, blockFromJSON.Hash.String(), blockFromRLP.Hash.String())
		require.Equal(t, blockFromJSON.Withdrawals, blockFromRLP.Withdrawals)
	})

	t.Run("manual encoding", func(t *testing.T) {
		// To be absolutely sure we're doing this correctly, let's also manually build up the RLP of the block
		// based on our reading of the EIP, and comprare what we get with what we can generate from the rawRLP and JSON
		rlpRepresentationOfBlock := rlp.Value{
			List: []rlp.Value{
				{
					/*
						execution_payload_header_rlp = RLP([
						  parent_hash,
						  0x1dcc4de8dec75d7aab85b567b6ccd41ad312451b948a7413f0a142fd40d49347, # ommers hash
						  coinbase,
						  state_root,
						  txs_root,
						  receipts_root,
						  logs_bloom,
						  0, # difficulty
						  number,
						  gas_limit,
						  gas_used,
						  timestamp,
						  extradata,
						  prev_randao,
						  0x0000000000000000, # nonce
						  base_fee_per_gas,
						  withdrawals_root,
						])
					*/
					List: []rlp.Value{
						blockFromJSON.ParentHash.RLP(),
						blockFromJSON.SHA3Uncles.RLP(),
						blockFromJSON.Miner.RLP(),
						blockFromJSON.StateRoot.RLP(),
						blockFromJSON.TransactionsRoot.RLP(),
						blockFromJSON.ReceiptsRoot.RLP(),
						blockFromJSON.LogsBloom.RLP(),
						blockFromJSON.Difficulty.RLP(),
						blockFromJSON.Number.RLP(),
						blockFromJSON.GasLimit.RLP(),
						blockFromJSON.GasUsed.RLP(),
						blockFromJSON.Timestamp.RLP(),
						blockFromJSON.ExtraData.RLP(),
						blockFromJSON.MixHash.RLP(),
						blockFromJSON.Nonce.RLP(),
						blockFromJSON.BaseFeePerGas.RLP(),
						blockFromJSON.WithdrawalsRoot.RLP(),
					},
				},
				// transactions
				{
					List: []rlp.Value{},
				},
				// uncles
				{
					List: []rlp.Value{},
				},
				// withdrawals
				{
					List: make([]rlp.Value, len(blockFromJSON.Withdrawals)),
				},
			},
		}

		// populate withdrawals list
		for i := range blockFromJSON.Withdrawals {
			rlpRepresentationOfBlock.List[3].List[i] = blockFromJSON.Withdrawals[i].RLP()
		}

		t.Run("compare encoded RLP", func(t *testing.T) {
			parsedRawRLP, err := rlp.From(rawRLP)
			require.NoError(t, err)
			require.Equal(t, *parsedRawRLP, rlpRepresentationOfBlock)
		})

		t.Run("encode and decode", func(t *testing.T) {
			createdRLP, err := rlpRepresentationOfBlock.Encode()
			require.NoError(t, err)
			require.Equal(t, rawRLP, createdRLP)

			b := eth.Block{}
			err = b.FromRaw(createdRLP)
			require.NoError(t, err)

			require.Equal(t, blockFromJSON.Hash.String(), b.Hash.String())
			require.Equal(t, blockFromJSON.Withdrawals, b.Withdrawals)
		})
	})
}
